					<h1>Демонтаж опорной плиты</h1>
									<p>Объект: режимный объект, г. Новороссийск, Краснодарский край</p>

<p>Задача: демонтаж опорной плиты толщиной 1200мм, с делением на фрагменты. </p>

<p>Работа была произведена с применением канатной установки HILTI  TSWS 3018 с погружными стойками. Так же использовались бурильные установки HILTI DD350 для бурения отверстий Ф252мм под погружные стойки.</p>

<p>Работы производились круглосуточно и были выполнены в срок.</p> 		<div style="clear:both"></div>
